-- Table structure for table `articles`

CREATE TABLE IF NOT EXISTS `articles` (
    `id` INT(11) UNSIGNED NOT NULL AUTO_INCREMENT,
    `title` VARCHAR(250) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'titulo del articulo',
    `description` TEXT COLLATE utf8_unicode_ci COMMENT 'descripción para el articulo',
    `created_at` DATETIME DEFAULT NULL,
    `updated_at` DATETIME DEFAULT NULL,
    PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='tabla de articulos';

